        <header className="tpt">About me</header>
        <main className="tpt">
          I am a full-stack web devloper based in Salt Lake City, Utah
        </main>
        <p className="tpt">
          Lorem ipsum dolor sit amet et delectus accommodare his consul copiosae
          legendos at vix ad putent
